export default class extends React.Component {
    render() {
        return (
            <>
                <nav id='menu'>
                    <ul>
                        <li>
                            <button type='button' className='btm'></button>
                            <ul>
                                <li><button type='button' className='rectangulo' disabled>Settings</button></li>
                                <li><button type='button' className='rectangulo'>Profile</button></li>
                                <li><button type='button' className='rectangulo'>Settings</button></li>
                            </ul>
                        </li>
                    </ul>
                </nav>
                <style jsx>{`
            #menu .btm{
                width: 2.5rem;
                height: 2.5rem;
                border-radius:150px;
                border: 1px solid;
            }

            #menu .rectangulo{
                width: 100%;
                background: transparent;
                border: none;
            }

            .btm:hover{
                opacity: 0.50;
                -moz-opacity: .50;
                filter:alpha (opacity=50);
            }

            #menu ul{
                list-style:none;
                margin:0;
                padding:0;
            }

            #menu ul .btm{
                display:block;
                text-decoration:none;
                font-weight:400;
                padding:10px;
                text-transform:uppercase;
            }

            #menu ul li {
                position:relative;
                float:left;
                margin:0;
                padding:0;
            }

            #menu ul ul {
                display:none;
                position:absolute;
                top:100%;
                left:0;
                padding:0;
                border-radiux: 5px;
            }

            #menu ul ul li {
                float:none;
                width:250px;
                margin-left: -200px;
                background: white;
                border: 1px solid;
            }

            #menu ul ul button {
                line-height:120%;
                padding:10px 15px;
            }

            #menu ul li:hover > ul {
                display:block;
            }
        `}</style>
            </>
        );
    }
}
